import logo from './logo.svg';
import './App.css';

const NavigationBar = () => {
  return (
      <header>
        <nav>
          <ul>
            <li>home</li>
            <li>profile</li>
          </ul>
        </nav>
      </header>
  )
}

function App() {
  return (
    <div className="App">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
      <NavigationBar/>
    </div>
  );
}

export default App;
